import React from 'react'
import { Link, useH } from 'react-router-dom'
import UpdateUser from '../pages/UpdateUser'
export default function AdminAction() {
  const history = useHistory();

  const navigateTo = () => {
    history.push('/componentURL'); // Replace '/componentURL' with the path you want to navigate to
  };
  return (
    <ul class="nav">
      <li class="nav-item">
        <a class="nav-link active" aria-current="page" href="/UpdateUser">User</a>
      </li>
      <li class="nav-item">
        <a class="nav-link active" aria-current="page" href="#">Add Keyword</a>
      </li>
    </ul>
  )
}
